import React, { PureComponent } from "react";
import { RadarChart } from "react-vis";

import AppLayout from "../components/AppLayout";
const RADAR_PROPS = {
  data: [
    {
      neatExplosions: 7,
      wow: 10,
      dog: 8,
      sickMoves: 9,
      nice: 7,
    },
  ],
  domains: [
    { name: "nice", domain: [0, 100] },
    {
      name: "explosions",
      domain: [6.9, 7.1],
      getValue: (d) => d.neatExplosions,
    },
    { name: "wow", domain: [0, 11] },
    { name: "sickMoves", domain: [0, 20] },
  ],
  height: 300,
  width: 400,
};
const myData = [{ angle: 1 }, { angle: 5 }, { angle: 2 }];

export default class Profile extends PureComponent {
  render() {
    return (
      <AppLayout>
        <div>Hello, 프로필</div>
        <RadarChart
          data={mydata}
          style={{
            axes: {
              line: {},
              ticks: {},
              text: {},
            },
            labels: {
              fontSize: 10,
            },
            polygons: {
              strokeWidth: 0.5,
              strokeOpacity: 1,
              fillOpacity: 0.1,
            },
          }}
        />
      </AppLayout>
    );
  }
}
